                {
                    SetElement(i, j, matrix[i, j]);
                }
            }
        }

        public static void FixScatterMatrixArray(ref byte[,] matrixArray, out byte[] jackpotPosition)
        {
            jackpotPosition = null;
            var scatPos = new int[3];
            var countScat = 0;
            for (var i = 1; i < 4; i++)
            {
                scatPos[i - 1] = -1;
                for (var j = 1; j < 4; j++)
                {
                    if (matrixArray[i, j] == 0)
                    {
                        scatPos[i - 1] = j;
                        countScat++;
                        break;
                    }
                }
            }
            if (scatPos[0] >= 0 && scatPos[1] >= 0 && scatPos[2] >= 0)
            {
                if (SoftwareRng.Next() < _Constant3)
                {
                    jackpotPosition = new byte[] { (byte)(scatPos[0] * 5 + 1), (byte)(scatPos[1] * 5 + 2), (byte)(scatPos[2] * 5 + 3), 255, 255 };
                    matrixArray[1, scatPos[0]] = 10;
                    matrixArray[2, scatPos[1]] = 10;
                    matrixArray[3, scatPos[2]] = 10;
                }
                else
                {
                    TransformMatrix3Middle(ref matrixArray, scatPos);
                }
                return;
            }
            if (countScat == 2)
            {
                TransformMatrix2Middle(ref matrixArray, scatPos);
                return;
            }
            if (countScat == 1)
            {
                TransformMatrix1Middle(ref matrixArray, scatPos);
            }
        }

        private static void TransformMatrix3Middle(ref byte[,] matrixArray, int[] scatPos)
        {
            var rnd = SoftwareRng.Next();
            if (rnd < 0.36)
            {
                matrixArray[1, scatPos[0]] = 10;
                matrixArray[2, scatPos[1]] = 10;
            }
            else if (rnd < 0.405)
            {
                matrixArray[1, scatPos[0]] = 10;
                matrixArray[3, scatPos[2]] = 10;
            }
            else if (rnd < 0.45)
            {
                matrixArray[2, scatPos[1]] = 10;
                matrixArray[3, scatPos[2]] = 10;
            }
            else if (rnd < 0.56666667)
            {
                matrixArray[1, scatPos[0]] = 10;
            }
            else if (rnd < 0.6833333)
            {
                matrixArray[2, scatPos[1]] = 10;
            }
            else if (rnd < 0.8)
            {
                matrixArray[3, scatPos[2]] = 10;
            }
        }

        private static void TransformMatrix2Middle(ref byte[,] matrixArray, int[] scatPos)
        {
            var rnd = SoftwareRng.Next();
            var I = scatPos[0] >= 0 ? 0 : 1;
            var J = I == 0 ? (scatPos[1] >= 0 ? 1 : 2) : 2;
            if (rnd < 0.2)
            {
                matrixArray[I + 1, scatPos[I]] = 10;
                matrixArray[J + 1, scatPos[J]] = 10;
            }
            else if (rnd < 0.4)
            {
                matrixArray[I + 1, scatPos[I]] = 10;
            }
            else if (rnd < 0.6)
            {
                matrixArray[J + 1, scatPos[J]] = 10;
            }
        }

        private static void TransformMatrix1Middle(ref byte[,] matrixArray, int[] scatPos)
        {
            var rnd = SoftwareRng.Next();
            if (rnd >= 0.65)
            {
                return;
            }
            for (int i = 0; i < 3; i++)
            {
                if (scatPos[i] >= 0)
                {
                    matrixArray[i + 1, scatPos[i]] = 10;
                    return;
                }
            }
        }

